@snowbreeeze ofc everyone is still infectious (although as not as much as w/o masks) through the masks and social distancing protocols! for instance if i go to a grocery store and i pick up a bag of flour and afterwards put it back, the virus could also be on that surfaces what (also known as fomites). so unless you say that everyone disinfects their hands before and after touching every single surface (which isn’t the case) they are still infectious one way and another.

anyway I didn’t say the cb isn’t working, ofc it is since there is generally a downward trend in the number of ‘community spread’ cases. just remember that sg is very small and rather densely populated also so it’s much easier for stuff to transmit, so ofc such a ‘pseudo/partial lockdown’ is required that’s why the govt is willing to even halt construction services atm and extend the cb for 4 more weeks. 
idk what u mean by ‘country interests surpasses conscience’
